# Решение задачи предсказания частично заполненной числовой характеристики узлов сети с помощью графовой нейронной сети

import networkx as nx
import pandas as pd
import numpy as np
import os
import matplotlib.pyplot as plt

import stellargraph as sg
from stellargraph.mapper import FullBatchNodeGenerator
from stellargraph.layer import GCN

from tensorflow.keras import layers, optimizers, losses, metrics, Model
from tensorflow.keras.callbacks import EarlyStopping

from sklearn import preprocessing, model_selection

from IPython.display import display, HTML

# https://networkrepository.com/citeseer.php

from IPython.display import Image
# Image(url='GNNanimation.gif')

dataset = sg.datasets.CiteSeer()
G, node_features = dataset.load()

for i in range(len(node_features)):
  if node_features[i] == 'DB':
    node_features[i] = 7
  if node_features[i] == 'IR':
    node_features[i] = 6
  if node_features[i] == 'Agents':
    node_features[i] = 5
  if node_features[i] == 'ML':
    node_features[i] = 4
  if node_features[i] == 'HCI':
    node_features[i] = 3
  if node_features[i] == 'AI':
    node_features[i] = 2
    
node_features = node_features.astype('int')

len(G.edges())

display(HTML(dataset.description))

"""Датасет:

- Включает 3312 научных работ
- 6 категорий для классификации - сколько лет назад была опубликована статья
- Признаки узла - это (1) или (0) - есть ли в статье определенное слово
- 3703 искомых слов
"""

color_map = []

for i in list((node_features.to_frame().reset_index(drop=True))['subject']):
  if i == 20:
    color_map.append(100)
  if i == 17:
    color_map.append(200)
  if i == 14:
    color_map.append(300)
  if i == 10:
    color_map.append(400)
  if i == 6:
    color_map.append(500)
  if i == 2:
    color_map.append(600)

plt.figure(figsize=(14, 14))
plt.axis('off')
G_nx = nx.to_networkx_graph(G.edges())

nx.draw_networkx(G_nx,
                 pos=nx.spring_layout(G_nx), 
                 node_size = 50,
                 node_color = color_map,
                 edge_color = 'grey',
                 with_labels = False,
                 alpha = 0.7,
                 )

plt.show()

node_features.value_counts().to_frame() # количество статей по каждой категории

# Получаем обучающую, тестовую и валидационную выборку:

# 80% - обучающие данные
train_feat, test_feat = model_selection.train_test_split(
    node_features, test_size=0.2, stratify=node_features
)

# 14% - тестовые данные
# 6% - валидационные данные
val_feat, test_feat = model_selection.train_test_split(
    test_feat, test_size=0.3, stratify=test_feat
)

train_feat.to_frame()

train_feat.value_counts().to_frame() # количество статей по каждой категории в обучающей выборке

# Мы используем LabelBinarizer() для преобразования меток классов, то есть какому классу принадлежит данная статья
# После преобразования мы получаем вектор из 0 или 1 (отвечают за вхождение статьи в определенный категорию)

binarizer = preprocessing.LabelBinarizer()

train_targets = binarizer.fit_transform(train_feat)
test_targets = binarizer.fit_transform(test_feat)
val_targets = binarizer.fit_transform(val_feat)

train_targets

# Далее мы используем 'генератор' из StellarGraph
# Он возвращает матрицу Лапласа, которую наша модель будет использовать 
# Выбирая метод 'gcn', это означает что он будет выдавать данные, 
# подходящие конкретно для алгоритма GCN, используя матрицу Лапласа 

generator = FullBatchNodeGenerator(G, method='gcn') 

# Создание объекта для обучения модели
# Используем только те узлы и метки, на которых будем происходить обучение
train_gen = generator.flow(train_feat.index, train_targets)



"""![image.png](data:image/png;base64,)"""

from tensorflow.keras.metrics import MeanSquaredError

gcn = GCN(layer_sizes = [32, 32], # 2 слоя, 32-мерными скрытыми объектами
          activations = ['relu', 'relu'], # функция активации, линейность
          generator = generator, 
          dropout = 0.5 # параметр предназначен для предотвращения переобученности и разрыва связи
          )

# создаем входные и выходные тензоры
x_inp, x_out = gcn.in_out_tensors()
predictions = layers.Dense(units = train_targets.shape[1], activation = 'softmax')(x_out)

# model = Model(inputs = x_inp, outputs = predictions)

# model.compile(
#     optimizer = optimizers.Adam(learning_rate = 0.0005), 
#     loss = losses.categorical_crossentropy, 
#     # metrics = ['acc'] # метрики для мониторинга mean_squared_error
#     metrics = [MeanSquaredError()]
#   )# функция потерь

model = Model(inputs = x_inp, outputs = predictions)

model.compile(
    optimizer = optimizers.Adam(learning_rate = 0.0005), 
    loss = losses.categorical_crossentropy, # функция потерь
    metrics = [MeanSquaredError()] # метрики для мониторинга
  )

# Добавляем валидационные данные для отслеживания accuracy
val_gen = generator.flow(val_feat.index, val_targets)

# Функция отслеживания mean_squared_error валидационных данных, которая может останавить обучение модели при ухудшении качества
early_stop = EarlyStopping(monitor = 'val_mean_squared_error', patience = 30, restore_best_weights=True)

history = model.fit(
    train_gen,
    epochs = 700,
    validation_data = val_gen,
    verbose = 1,
    shuffle=False,  # Не перемешиваем обучающие данные перед каждой эпохой
    callbacks = [early_stop],
  )

sg.utils.plot_history(history)

# Получаем результаты работы модели на тестовых данных
test_gen = generator.flow(test_feat.index, test_targets)
test_metrics = model.evaluate(test_gen)

# Теперь с помощью нашей модели, получим предсказание по всем узлам
# Для обучения мы использовали и связи между узлами, и метки
# Сейчас на вход подаются только связи между узлами

nodes = node_features.index
gen_nodes = generator.flow(nodes)
nodes_predictions = model.predict(gen_nodes)

nodes_predictions.shape, nodes_predictions.squeeze().shape

node_predictions = binarizer.inverse_transform(nodes_predictions.squeeze())

dataframe = pd.DataFrame({'Predicted result' : node_predictions, 'True results' : node_features})
dataframe

dataframe[dataframe['Predicted result'] != dataframe['True results']]





